●大人気のチェック柄11色●人気のチェック柄をバリエーション豊かな11色をご用意したオリジナルカーマットです。素材はポリプロピレンで、チェックの升目１辺は約30ｍｍです。毛先がループ状になっており、素材の硬さをやわらげているので踏み心地は抜群！チェック柄の段差が高級感のある仕上がりとなり、貴方の愛車を演出します。受注生産品なので全てにおいてこだわり、耐久性や耐磨耗性、耐火性など、まったく純正マットと変わらない高品質です！<br>◆1台分1セット ◆滑止用粘着フェルト適用 ◆メーカー車種別フック対応 ※旧車は穴位置が異なる場合がございます。<br>※生地は、染色ロット、パソコン環境等により、実際のカラーと異なる場合がございますので予めご了承下さい。※生地裁断によって柄の出方が変わります。お手元に届く商品が写真の柄の出方と異なる場合がございます。 ※納期：受注生産のため、1～2週間程度。完全受注生産のためご注文後のキャンセル・返品は不可。※代引き不可<br><br>対応車種 ： 4/11～8/9 ｲﾝﾌﾟﾚｯｻ GC1/4/6/8/GF1/3/4/6/8/GFA <br><br>インテリア | フロアマット<br>スバル | インプレッサ | GC/GF系<tr><td colspan="2">
